import React from "react";
import Example from "./example";

function App() {
  return (
    <div>
      <Example render={
        {function (isDaytime) {
          return <h1>{isDaytime ? "Good day" : "Good evening"}, Bob!</h1>;
        }}}
      />
    </div>
  );
}

export default App;
